import React from 'react'

export const PurchaseBenefits = () => {
    return (
        <div className="purchaseBenefits-list">
           <ul>
            <li></li>
            <li><i class="fa-solid fa-check"></i>Trả hàng miễn phí 15 ngày</li>
            <li>Chính hãng 100%</li>
            <li>Miễn phí vận chuyển<i class="fa-solid fa-chevron-down"></i></li>
           </ul>
        </div>
    )
}
